import yi from './utils'
const countState = yi({
  count : 0
})

function App() {
  const {count} = countState()
  return (
    <div className="App">
      {count}
      <AddBtn/>
    </div>
  );
}

const AddBtn = ()=>{
  let {count} = countState()
  return <button onClick={()=>count += 1}> add </button>
} 

export default App;
